import '../CSSContents/Home.css';
import React from 'react';
import { Link } from 'react-router-dom';


function Home() {

    return (

        <div className="Home">
            <h1>Check out what is the best option for your Business!</h1>

            <div className='cards__container'>
                <div className='cards__wrapper'>

                    <Link className='cards__items' to='GymSolution'> <img src='images/897.jpg' height={200} width={400} />
                        t<h1> Gym Business</h1>
                    </Link>


                    <Link className='cards__items' to='/Shop'> <img src='images/img-2.jpg' height={220} width={420} />
                        <h1>Other Business</h1>
                    </Link>


                    <Link className='cards__items' to='Login'><img src='images/img-3.jpg' height={220} width={420} />
                        <h1>Other Business2</h1>
                    </Link>

                </div>
            </div>
        </div>
    )
}
/*
 <Link to='/Login' ><button className="login">Login</button></Link>

*/

function CardItem(props) {
    return (
        <>
            <li className='cards__item'>
                <Link className='cards__item__link'>
                    <figure className='cards__item__pic-wrap' data-category={props.label}>
                        <img
                            className='cards__item__img'
                            alt='Travel Image'
                            src={props.src}
                        />
                    </figure>
                    <div className='cards__item__info'>
                        <h5 className='cards__item__text'>{props.text}</h5>
                    </div>
                </Link>
            </li>
        </>
    );
}

export default Home;
